import React, { useState } from 'react';

const SimplexForm = () => {
  const [objectiveFunction, setObjectiveFunction] = useState('');
  const [decisionVariables, setDecisionVariables] = useState('');
  const [constraints, setConstraints] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Aqui você pode enviar os dados para o backend
    console.log({
      objectiveFunction,
      decisionVariables,
      constraints,
    });
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Função Objetivo:</label>
        <input
          type="text"
          value={objectiveFunction}
          onChange={(e) => setObjectiveFunction(e.target.value)}
        />
      </div>
      <div>
        <label>Variáveis de Decisão:</label>
        <input
          type="text"
          value={decisionVariables}
          onChange={(e) => setDecisionVariables(e.target.value)}
        />
      </div>
      <div>
        <label>Restrições:</label>
        <textarea
          value={constraints}
          onChange={(e) => setConstraints(e.target.value)}
        />
      </div>
      <button type="submit">Calcular</button>
    </form>
  );
};

export default SimplexForm;
